sys_variable_value.value:
(function execute(inputs, outputs) {
    outputs.code = (inputs.errorCode != 400 && inputs.errorCode != 500) ? 400 : inputs.errorCode;
    outputs.message = (inputs.errorCode != 400 && inputs.errorCode != 500) ? "Internal Server Error" : inputs.errorMessage;

})(inputs, outputs);

